import React from 'react';
import ReactDOM from 'react-dom';

function myList() {
    return ['Ye', 'No', 'Maybe'];
}

function MyApp() {
    return (
    <ul>
        <li>{ myList()[0, 1] }</li>
        <li>No</li>
        <li>Maybe</li>
    </ul>
    )
}

ReactDOM.render(<MyApp />, document.getElementById("root"));
